Promotional info for the collected edition - &quot;The complete 12-part saga from SUPERMAN #204-215 written by Brian Azzarello with sensational art by Jim Lee!
A cataclysmic event has struck the Earth. Millions of people have vanished without a trace. No one is left unaffected; not even Superman! But after a year, Superman is left with many questions. For a hero who tries to have all the answers, it's torture. And, just as the action heats up and the stakes are raised, one huge question emerges: Just how far is Superman willing to go 'For Tomorrow?'&quot;

These are all the individual issues of the storyline that contain the 12-part story arc, which is from Superman v2 204-215. All are digital copies by Empire. Thanks to those scanners for their hard work, please seed and enjoy! :-)
